/*Table structure for table `company_stage` */

DROP TABLE IF EXISTS `company_stage`;

CREATE TABLE `company_stage` (
  `company_stage_id` int(4) NOT NULL AUTO_INCREMENT,
  `stage_title` varchar(128) DEFAULT NULL,
  `stage_desc` varchar(256) DEFAULT NULL,
  `icon_path` varchar(256) NOT NULL,
  `is_active` tinyint(1) NOT NULL,
  `create_systemuser_id` int(8) NOT NULL,
  `create_timestamp` datetime DEFAULT NULL,
  `update_systemuser_id` int(8) NOT NULL,
  `update_timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`company_stage_id`),
  UNIQUE KEY `company_stage_id_UNIQUE` (`company_stage_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;

