  `current_industry_id` int(8) NOT NULL AUTO_INCREMENT,
  `industry_name` varchar(128) NOT NULL,
  `icon_path` varchar(256) DEFAULT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  `create_systemuser_id` int(8) NOT NULL,
  `create_timestamp` datetime NOT NULL,
  `update_systemuser_id` int(8) NOT NULL,
