  PRIMARY KEY (`current_industry_id`),
  UNIQUE KEY `current_industry_id_UNIQUE` (`current_industry_id`)
) ENGINE=InnoDB AUTO_INCREMENT=52 DEFAULT CHARSET=latin1;

